import React from 'react'

const Sidebar = () => {
  return (

    <ul className="sidenav" id="mobile-links">
       <li><a href="#">Log In</a></li>
        <li><a href="#">Sign Up</a></li>
        <li><a href="#">About</a></li>
      </ul>
  )
}


export default Sidebar
